‚Å†
This is one of the best ways to use all of your fresh fruit and it's absolutely delicious! ‚Å†
‚Å†
Ingredients‚Å†
- 10-12 apples, peeled, cored, and chopped, (Any variety will do. We like to use a mix of different tart and sweet varieties.)‚Å†
- 2 T. lemon juice‚Å†
- 1/2 C. pure maple syrup‚Å†
- 1/2 tsp. salt‚Å†
- 1 1/2 tsp. pure vanilla extract‚Å†
- 3 tsp. cinnamon‚Å†
- 1/2 tsp. cloves‚Å†
‚Å†
Instructions‚Å†
(1) Add all ingredients to the slow cooker, and stir to coat all apples evenly.‚Å†
(2) Cook on low for about 4 or 5 hours, or until the apples are soft.‚Å†
(3) Using an immersion blender, blitz the apples until smooth, (or allow to cool slightly, then mix in batches in a standard blender).‚Å†
(4) Continue to cook for 1 to 2 more hours in slow cooker until the apple butter is thick and spreadable.‚Å†
(5) Transfer to glass jars with lids, or storage container of your choice. Keeps well in the fridge for about a week, and freezes well.";}i:212;a:1:{s:14:"comments_count";i:1;}i:213;a:1:{s:11:"likes_count";i:4;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvPboUoicf";}i:215;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118776416_207563104130332_7457774062412179492_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=gE3Pyx6R-rYAX_4JKIA&oh=34190b8fdfeca93a0fd3a979552b885c&oe=5F7DF79D";}i:216;a:1:{s:4:"type";s:5:"image";}i:217;a:1:{s:8:"owner_id";i:401875684;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2391196766411200882";}i:222;a:1:{s:10:"short_code";s:11:"CEvPMo6AJly";}i:223;a:1:{s:12:"created_time";i:1599272889;}i:224;a:1:{s:7:"caption";s:702:"Now that I have your attention check out our Cozy Lodge Near Byron Bay, the perfect place to come together with friends and family! Or small retreats ...Book your family staycation! .
